import React, { useEffect, useState } from "react"
import arr from "./obj"

const { default: WhoWeHelp_Fundactions } = require("./WhoWeHelp_Fundations");
const { default: WhoWeHelp_Text } = require("./WhoWeHelp_Text");
const { default: WhoWeHelp_Pagination } = require("./WhoWeHelp_Pagination");
const { default: WhoWeHelp_Title } = require("./WhoWeHelp_Title");


let WhoWeHelp = () =>{

    let fundacje = arr[0]
    let organization = arr[1]
    let lokal = arr[2]

    let [materialy, setMaterialy] = useState(organization)

    let handleClikFundacje = () => {
        setMaterialy(fundacje)

    }
    let handleClikOrganization = () => {
        setMaterialy(organization)
    }

    return(
        <section className="WhoWeHelp">




            <WhoWeHelp_Title />
            <p className="WhoWeHelp_A"></p>


            <div className="WhoWeHelp_ThreeColumns">
            <div>
                <button onClick={handleClikFundacje}>Fundacjom</button>
            </div>
            <div>
                <button onClick={handleClikOrganization}>Organizacją<br/> pozarządowym</button>
            </div>
            <div>
                <button >Lokalnym zbiórką</button>
            </div>
            </div>

            <WhoWeHelp_Text />
            <WhoWeHelp_Fundactions mate={materialy}/>


        </section>
    )
}

export default WhoWeHelp
